import React, { Fragment } from "react";
import { Form, Icon, Grid } from "semantic-ui-react";
import "./App.css";

function App() {
  return (
    <Fragment>
      <nav>
        <div className="logo">
          <h2>TodoList</h2>
        </div>
      </nav>
      <div className="bf">
        <Grid textAlign="center" >
          <Grid.Column className="grid-width" >
            <Form className="form"  size="large">
              <Form.Input width={9} placeholder="Add Task" required/>
              <button className="btn">Add Task</button>
              <Form.Button  color="green" inverted >
                <Icon name="checkmark"/>Add Task
              </Form.Button>
            </Form>
          </Grid.Column>
        </Grid>
      </div>
    </Fragment>
  );
}

export default App;
